    of unconsolidated deposits and bedrock in the Big Delta A-4 Quadrangle, Alaska.
    This map is based on field observations begun by Pu00e9wu00e9 in 1949 and by Reger
    in 1976. Unit characteristics and extents were determined during field visits and
    by interpreting 1:40,000-scale black-and-white aerial photographs taken in August
    1949 and 1:63,360-scale, false-color infrared aerial photographs taken in July 1978,
